import React from "react";
import S from "./style";
import BasicButton from "../button/BasicButton";

const Header = ({ isLoggedIn, user }) => {
    return (
        <S.HeaderWrapper>

            <S.LogoWrapper>
                <img src="../../../../public/assets/img/logo.svg" alt="MungPick 로고" />
            </S.LogoWrapper>

            <S.Menu>
                {isLoggedIn ? (
                    <>
                        <S.MenuItem>친구들 보러가기</S.MenuItem>
                        <S.MenuItem>FAQ</S.MenuItem>
                        <S.MenuItem>멍게시판</S.MenuItem>
                    </>
                ) : (
                    <>
                        <S.MenuItem>FAQ</S.MenuItem>
                        <S.MenuItem>이용후기</S.MenuItem>
                    </>
                )}
            </S.Menu>

            <S.Actions>
                {isLoggedIn ? (
                    <>
                        <S.Badge>
                            <img src="/icon/bell.svg" alt="알림" />
                            <S.BadgeCount>2</S.BadgeCount>
                        </S.Badge>
                        <img src="/icon/send.svg" alt="쪽지" />
                        <img src="/icon/calendar.svg" alt="일정" />
                        <S.ProfileImg src={user?.profileImage} alt="프로필" />
                    </>
                ) : (
                    <>
                        <BasicButton variant="filled" roundButton="small">로그인</BasicButton>
                        <BasicButton variant="filled" roundButton="small">회원가입</BasicButton>
                    </>
                )}
            </S.Actions>
        </S.HeaderWrapper>
    );
};

export default Header;
